  <el-card  class="forms">
    <div slot="header" class="clearfix">
      <span class="logo-title">中西医数字健康管理平台</span>
    <p class="title">用户登录</p>
    </div>
    <p class="skip" @click="jumpOutOf">跳过登录</p>
    <div class="main">
    <el-form label-position="left" label-width="80px" :model="user" class="login-form" :rules="rules" ref="users">
      <el-form-item label="用户名" prop="name">
        <el-input v-model="user.name" placeholder="输入用户名"></el-input>
      </el-form-item>
      <el-form-item label="密码" prop="password">
        <el-input v-model="user.password" type="password"  placeholder="输入密码" show-password></el-input>
      </el-form-item>
    </el-form>
    </div>
    <div class="logIn">
     <p class="skip1" @click="signIn">没有账号?点击注册</p>
      <el-button type="primary" @click="register(user)" class="button">登录</el-button>
    </div>
  </el-card >
  <transition name="slide">
<sign-in :open="open"  v-if="open" @close="open=!open"></sign-in>
  </transition>
  <transition name="slide">
  <Ma-sk v-if="open"></Ma-sk>
  </transition>
</div>
</template>

<script>
import {logIn} from "../axios/AllRequest";
import  signIn from  "./catalogue/signIn.vue"
import Mask from "../ui-FZ/Mask.vue"

export default {
  components:{
    signIn,
    'Ma-sk':Mask
  },
data(){
  return {
    user:{
      name:'',
      password:''
    },
    excessive:false,
    open:false,
    rules:{
      name:[
        { required: true, message: '请输入用户名', trigger: 'blur' },
      ],
      password:[
        { required: true, message: '请输入密码', trigger: 'blur' },
      ]
    }
  }
},
  mounted() {
  },
  methods:{
    register(){
      this.$refs.users.validate((valid)=>{
         if(valid){
            //接口
           logIn('/home/login',{
              username:this.user.name,
             password:this.user.password
           }).then((msg)=>{
             if(msg.data.status==200){
               this.$message({
                 message: '登录成功,即将跳转',
                 type: 'success',
                 customClass: 'winClass'
               });
               this.$store.dispatch('A/AsetUser', this.user.name)
               setTimeout(()=>{
                 this.$router.push({
                   path:'/homepage',
                 })
               },1000)
             }

             if(msg.data.status==201){
               // this.user.password=''
               this.$message({
                 message: '密码错误',
                 type: 'error'
               });

             }
             if(msg.data.status==202){
              // this.user.password=''
               this.$message({
                 message: '用户不存在',
                 type: 'warning'
               });
             }
           }).catch((error)=>{
             console.log(error)
             this.$message({
               message: '服务器错误,请联系管理员',
               type: 'error'
             });
           })
         }
         else{
           console.log('false')
           return false;
         }
      })

    },
    signIn(){
 this.open=!this.open;
    },
    jumpOutOf(){
      this.excessive=true;
      this.$router.push({
        path:'/homepage',
      })
    }
  }
}

</script>
